CREATE TRIGGER `td_cobro_ventas` AFTER DELETE ON `cobro_ventas` FOR EACH ROW BEGIN

declare _venta int;
declare _periodo int;
declare _monto float;
declare _monto_ingreso float;
declare _monto_egreso float;
declare _tc float;
declare _cmovimiento int;
declare _banco int;
declare _fecha date;
declare _mperiodo int;
declare _glosa varchar(245);
declare _pagado float;


set _venta = old.venta;
set _periodo = old.periodo;
set _monto = old.monto;
set _banco = old.banco;
set _fecha = old.fecha;
set _tc = old.tc;
set _pagado = _monto * _tc;

update ventas set estado = 0, pagado = pagado - _pagado where codigo = _venta and periodo = _periodo;

select concat ("ANULACION DE ", td.abreviado, " | ", lpad(v.serie, 3, 0), " / ", lpad(v.numero, 7,0), " | ", e.razon_social, " | " ,v.orden_cliente) 
into _glosa 
from ventas as v 
inner join tipo_documento as td on td.id = v.tipo_documento 
inner join clientes as c on c.id = v.cliente 
inner join entidad as e on e.ruc = c.ruc 
where v.periodo = _periodo and v.codigo = _venta;

set _mperiodo = concat (year(_fecha), lpad(month(_fecha), 2, 0));

select ifnull (max(movimiento) + 1, 1) into _cmovimiento 
from movimiento_bancos where banco = _banco and periodo = _mperiodo;

if (_monto > 0) THEN
	set _monto_ingreso = 0;
    set _monto_egreso = _monto;
else 
    set _monto_ingreso =  _monto * -1;
    set _monto_egreso = 0;
end if;


end
$$
