CREATE TRIGGER `td_detalle_despacho_material` AFTER DELETE ON `detalle_despacho_material` FOR EACH ROW BEGIN

declare _fecha date;
declare _ruc_entidad char(11);
declare _razon_entidad varchar(250);
declare _almacen int;
declare _despacho int;
declare _anio int;
declare _tido int;
declare _serie char(6);
declare _numero int;
declare _orden varchar(25);

declare _kardex int;
declare _material int;
declare _cantidad float;
declare _costo float;

set _despacho = old.id_despacho;
set _anio = old.anio;
set _material = old.id_material;
set _cantidad = old.cantidad;
set _costo = old.costo;

select di.id_almacen, di.fecha, di.id_orden_interna, cl.ruc  
into _almacen, _fecha, _orden, _ruc_entidad
from despacho_material as di 
inner join almacen as al on al.codigo = di.id_almacen 
inner join clientes as cl on cl.id = al.cliente 
inner join orden_interna as oi on oi.id_orden = di.id_orden_interna 
where di.id_despacho = _despacho and di.anio = _anio;

update material_almacen 
set cantidad = cantidad + _cantidad 
where almacen = _almacen and material = _material;

set _tido = 9;
set _serie = _anio;
set _numero = _despacho;

delete from kardex_material 
where material = _material and almacen = _almacen 
and tipo_documento = _tido and serie = _serie and numero = _numero;

END
$$
