DELIMITER $$
CREATE TRIGGER `ti_retorno_herramientas` AFTER INSERT ON `detalle_retorno_herramientas` FOR EACH ROW BEGIN

declare _fecha date;
declare _origen int;
declare _norigen varchar(250);
declare _ndestino varchar(250);
declare _destino int;
declare _ruc_origen char(11);
declare _ruc_destino char(11);
declare _retorno int;
declare _periodo int;
declare _id_documento varchar(20);
declare _cod_documento varchar(20);
declare _tipo_doc varchar(2);
declare _tido int;
declare _serie char(6);
declare _numero int;
declare _glosa varchar(250);
declare _cactual int;

declare _kardex int;
declare _herramienta int;
declare _tipo int;
declare _cantidad float;
declare _ctotal int;

declare _encontrado int;

set _encontrado = 0;
set _retorno = new.id_retorno;
set _periodo = new.periodo;
set _herramienta = new.id_herramienta;
set _tipo = new.tipo;
set _cantidad = new.cantidad;
set _id_documento = new.id_documento;

set _tipo_doc = substring(_id_documento, 0, 1);
set _cod_documento = trim(substr(_id_documento, 2, 10));

select r.fecha, r.almacen_origen, r.almacen_destino
into _fecha, _origen, _destino
from retorno as r
where r.id_retorno = _retorno and r.periodo = _periodo;

if (_id_documento like '1%') then
select i.tipo_documento, i.serie, i.numero, dih.cantidad
into _tido, _serie, _numero, _cactual
from detalle_ingreso_herramienta as dih
  inner join ingresos as i on dih.ingreso = i.id and dih.periodo = i.periodo
  inner join tipo_documento as td on td.id = i.tipo_documento
where concat('1-',i.periodo, i.id, dih.herramienta) = _id_documento and i.almacen = _origen;

update detalle_ingreso_herramienta
set cretorno = cretorno + _cantidad
where concat('1-',periodo, ingreso, herramienta) = _id_documento;
end if;

if (_id_documento like '2%') then
select t.documento, t.serie, t.numero, dth.cantidad
into _tido, _serie, _numero, _cactual
from detalle_traslado_herramienta as dth
  inner join traslado as t on dth.traslado = t.codigo and dth.periodo = t.periodo
  inner join tipo_documento as td on td.id = t.documento
where concat('2-',t.periodo, t.codigo, dth.herramienta) = _id_documento and t.destino = _origen;

update detalle_traslado_herramienta
set cretorno = cretorno + _cantidad
where concat('2-',periodo, traslado, herramienta) = _id_documento;
end if;

select a.nombre, cl.ruc
into _ndestino, _ruc_destino
from almacen as a
  inner join clientes as cl on cl.id = a.cliente
where a.codigo = _destino;

select a.nombre, cl.ruc
into _norigen, _ruc_origen
from almacen as a
  inner join clientes as cl on cl.id = a.cliente
where a.codigo = _origen;

if (_tipo = 1) THEN
VALUES (_destino, _herramienta, _cantidad, _fecha, '1');

delete from herramienta_almacen
where almacen = _origen and herramienta = _herramienta;
end if;

if (_tipo = 2) THEN
select count(*) into _encontrado
from herramienta_almacen as ha
where ha.almacen = _destino and ha.herramienta = _herramienta;

if (_encontrado = 0) THEN
VALUES (_destino, _herramienta, _cantidad, _fecha, '1');
else
update herramienta_almacen
set cactual = cactual + _cantidad
where almacen = _destino and herramienta = _herramienta;
end if ;

update herramienta_almacen
set cactual = cactual - _cantidad
where almacen = _origen and herramienta = _herramienta;

delete from herramienta_almacen
where almacen = _origen and herramienta = _herramienta and cactual = 0;
end if;

select h.ctotal into _ctotal
from herramientas as h
where h.idherramientas = _herramienta;

set _glosa = concat("PARA: ", _ndestino, ' ' , _cod_documento);

select ifnull (max(kh.kardex) + 1, 1)
into _kardex
from kardex_herramienta as kh
where kh.herramienta = _herramienta and kh.almacen = _origen;

VALUES (_herramienta, _kardex, _origen, _fecha, _ruc_destino, _glosa, _tido, _serie, _numero, _ctotal, 0, _cantidad, 11, now());

set _glosa = concat("DESDE: ", _norigen);

select ifnull (max(kh.kardex) + 1, 1)
into _kardex
from kardex_herramienta as kh
where kh.herramienta = _herramienta and kh.almacen = _destino;

VALUES (_herramienta, _kardex, _destino, _fecha, _ruc_origen, _glosa, _tido, _serie, _numero, _ctotal, _cantidad, 0, 11, now());

END
$$
DELIMITER ;

