set _traslado = old.id_traslado;
set _periodo = old.periodo;
set _material = old.id_material;
set _cantidad = old.cantidad;
set _costo = old.costo;

select t.fecha, t.origen, t.destino, t.documento, t.serie, t.numero 
into _fecha, _origen, _destino, _tido, _serie, _numero 
from traslado as t 
where t.codigo = _traslado and t.periodo = _periodo;

update material_almacen 
set cantidad = cantidad - _cantidad  
where almacen = _destino and material = _material;

delete from kardex_material 
where fecha = _fecha and serie = _serie and numero = _numero and almacen = _destino and material = _material;

update material_almacen 
set cantidad = cantidad + _cantidad  
where almacen = _origen and material = _material;

delete from kardex_material 
where fecha = _fecha and serie = _serie and numero = _numero and almacen = _origen and material = _material;

END
