DELIMITER $$
CREATE TRIGGER `ti_traslado_material` AFTER INSERT ON `detalle_traslado_material` FOR EACH ROW BEGIN

declare _fecha date;
declare _origen int;
declare _norigen varchar(250);
declare _ndestino varchar(250);
declare _destino int;
declare _ruc_origen char(11);
declare _ruc_destino char(11);
declare _traslado int;
declare _periodo int;
declare _tido int;
declare _serie char(6);
declare _numero int;
declare _glosa varchar(250);

declare _kardex int;
declare _material int;
declare _costo float;
declare _cantidad float;

declare _encontrado int;

set _encontrado = 0;
set _traslado = new.id_traslado;
set _periodo = new.periodo;
set _material = new.id_material;
set _cantidad = new.cantidad;
set _costo = new.costo;

select t.fecha, t.origen, t.destino, t.documento, t.serie, t.numero 
into _fecha, _origen, _destino, _tido, _serie, _numero 
from traslado as t 
where t.codigo = _traslado and t.periodo = _periodo;

select a.nombre, cl.ruc 
into _ndestino, _ruc_destino 
from almacen as a 
inner join clientes as cl on cl.id = a.cliente 
where a.codigo = _destino;

select a.nombre, cl.ruc 
into _norigen, _ruc_origen 
from almacen as a 
inner join clientes as cl on cl.id = a.cliente 
where a.codigo = _origen;

select count(*) into _encontrado 
from material_almacen as ma 
where ma.almacen = _destino and ma.material = _material;

if (_encontrado = 0) THEN
    VALUES (_destino, _material, _cantidad, _fecha, '0000-00-00'); 
else 
	update material_almacen 
    set cantidad = cantidad + _cantidad, ultimo_ingreso = _fecha  
    where almacen = _destino and material = _material;
end if ;

update material_almacen 
set cantidad = cantidad - _cantidad, ultima_salida = _fecha  
where almacen = _origen and material = _material;

set _glosa = concat("PARA: ", _ndestino);

select ifnull (max(km.kardex) + 1, 1) 
into _kardex 
from kardex_material as km 
where km.material = _material and km.almacen = _origen;

VALUES (_material, _kardex, _origen, _fecha, _ruc_origen, _glosa, _tido, _serie, _numero, 0, _cantidad, 0, _costo, 11, now());

set _glosa = concat("DESDE: ", _norigen);

select ifnull (max(km.kardex) + 1, 1) 
into _kardex 
from kardex_material as km 
where km.material = _material and km.almacen = _destino;

VALUES (_material, _kardex, _destino, _fecha, _ruc_destino, _glosa, _tido, _serie, _numero, _cantidad, 0, _costo, 0, 11, now());

END
$$
DELIMITER ;

