DELIMITER $$
CREATE TRIGGER `ti_movimiento_caja` AFTER INSERT ON `movimiento_caja` FOR EACH ROW BEGIN
declare _monto_egreso float;
declare _monto_ingreso float;
declare _monto float;
declare _caja int;
declare _tabla char(2);
declare _ctabla varchar(15);

declare _cpago int;
declare _fecha date;
declare _periodo int;
declare _compra int;
declare _monto_compra float;

set _monto_egreso = new.egreso;
set _monto_ingreso = new.ingreso;
set _caja = new.caja;
set _tabla = new.tabla;
set _ctabla = new.codigo_tabla;
set _fecha = new.fecha;

set _monto = _monto_ingreso - _monto_egreso;

update caja_chica 
set monto_disponible = monto_disponible + _monto 
where codigo = _caja;

if (_tabla = "C") THEN
    select ifnull(max(pago) + 1, 1) 
    into _cpago 
    from pago_compras 
    where concat(periodo,compra) = _ctabla;

    select periodo, codigo, total 
    into _periodo, _compra, _monto_compra 
    from compras 
    where concat(periodo,codigo) = _ctabla;

    VALUES (_cpago, _periodo, _compra, _fecha, _monto_egreso, now());

    if (_monto_egreso = _monto_compra) then 
        update compras 
        set estado = 1 
        where concat(periodo,codigo) = _ctabla;
    end if;
end if;

if (_tabla = "P") THEN
    update planilla 
    set estado = 1, monto_total = _monto_egreso 
    where codigo = _ctabla;
end if;

end
$$
DELIMITER ;

