DELIMITER $$
CREATE TRIGGER `ti_orden_interna` AFTER INSERT ON `orden_interna` FOR EACH ROW BEGIN
declare _cotizacion varchar(25);
declare _id_cliente int;
declare _id_sucursal int;
declare _id_almacen int;
declare _id_centro int;
declare _nombre varchar(45);
declare _anio int(4);

set _cotizacion = new.id_cotizacion;
set _anio = year(new.fecha_inicio);

update cotizaciones set estado = '2' where codigo = CONVERT(_cotizacion using utf8) collate utf8_spanish_ci;

select c.cliente, c.sucursal 
into _id_cliente, _id_sucursal 
from cotizaciones as c 
where c.codigo = CONVERT(_cotizacion using utf8) collate utf8_spanish_ci;

select concat(e.nombre_comercial, " - ", sc.nombre) 
into _nombre 
from sucursal_cliente as sc 
inner join clientes as c on c.id = sc.cliente 
inner join entidad as e on e.ruc = c.ruc 
where sc.id = _id_sucursal and sc.cliente = _id_cliente;

select count(a.codigo) 
into _id_almacen 
from almacen as a 
where a.cliente = _id_cliente and a.sucursal = _id_sucursal;

if (_id_almacen = 0) THEN
    select ifnull(max(codigo) + 1, 1) 
    into _id_almacen 
    from almacen;
    
end if;

select count(cc.codigo) 
into _id_centro 
from centro_costes as cc
where cc.id_cliente = _id_cliente and cc.id_sucursal = _id_sucursal and cc.anio = _anio;
if (_id_centro = 0) THEN
	select ifnull(max(codigo) + 1, 1) 
    into _id_centro 
    from centro_costes 
    where anio = _anio;
    
end if;
end
$$
DELIMITER ;

