--
-- Disparadores `ventas`
--
DELIMITER $$
CREATE TRIGGER `td_eliminar_venta` AFTER DELETE ON `ventas` FOR EACH ROW BEGIN
declare _cliente int;
declare _tc float;
declare _monto float;
declare _total_soles float;
declare _fecha date;
declare _orden varchar(20);
declare _porcentaje int;
declare _porcentaje_orden int;

set _cliente  = old.cliente;
set _tc = old.tipo_cambio;
set _monto = old.total;
set _fecha = old.fecha_factura;
set _orden = old.orden_cliente;
set _porcentaje = old.porcentaje_orden;

set _total_soles = _monto * _tc;

update clientes 
set total_facturado = total_facturado - _total_soles 
where id = _cliente;

update orden_cliente 
set facturado = facturado - _porcentaje, estado = 0 
where codigo = _orden;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `ti_ingreso_venta` AFTER INSERT ON `ventas` FOR EACH ROW BEGIN
declare _cliente int;
declare _tc float;
declare _monto float;
declare _total_soles float;
declare _fecha date;
declare _orden varchar(20);
declare _porcentaje int;
declare _porcentaje_orden int;

set _cliente  = new.cliente;
set _tc = new.tipo_cambio;
set _monto = new.total;
set _fecha = new.fecha_factura;
set _orden = new.orden_cliente;
set _porcentaje = new.porcentaje_orden;

set _total_soles = _monto * _tc;

update clientes 
set total_facturado = total_facturado + _total_soles, ultima_facturacion = _fecha 
where id = _cliente;

update orden_cliente 
set facturado = facturado + _porcentaje 
where codigo = _orden;

select facturado 
into _porcentaje_orden 
from orden_cliente 
where codigo = _orden;

if (_porcentaje_orden = 100) then 
update orden_cliente 
set estado = 1 
where codigo = _orden;
end if;
END
$$
DELIMITER ;

